import React, { useEffect, useState } from 'react';
import { IChartProps } from '../types/types';
import { Pie } from 'react-chartjs-2';

const Chart = (props: IChartProps) => {

   
   
    return (
        <>
            <Pie data={{
                labels: [5,7,8],
                datasets: [{
                    data: [200,400,500],
                    backgroundColor: ['red', 'green', 'blue']
                }]
            }}/>
        </>
    )
}

export default Chart;
